import React from 'react'
import { FaSearch,FaArrowAltCircleDown } from 'react-icons/fa';
export const Navbar = () => {

 function handleHover(){
    loginButton

 }
    return (
        <div >
            <div></div>
            <div>
                <input type="search"></input>
                    <button>
                        <FaSearch />
                    </button>
             
            </div>
            <div>
                <button onMouseEnter={handleHover} id='loginButton'>Login
                   <FaArrowAltCircleDown/>
                </button>
                
            </div>
        </div>
    )
}
